def threeSum(nums: [int]) -> [[int]]:
    if len(nums) < 3:
        return []
    nums.sort()
    l = len(nums)
    res = []
    for i in range(l - 2):
        has_f = 0
        for j in range(max(i + 1, 0), l - 1):
            for k in range(l - 1, j, -1):
                if nums[i] + nums[j] + nums[k] == 0:
                    if [nums[i], nums[j], nums[k]] not in res:
                        res.append([nums[i], nums[j], nums[k]])
                        has_f = 1
                        break
            if has_f > 0:
                break
        while j < k and j > i:
            if nums[i] + nums[j] + nums[k] > 0:
                k -= 1
            elif nums[i] + nums[j] + nums[k] < 0:
                j += 1
            elif nums[i] + nums[j] + nums[k] == 0:
                if [nums[i], nums[j], nums[k]] not in res:
                    res.append([nums[i], nums[j], nums[k]])
                k -= 1
                j += 1
    return  res

def isValid(s: str) -> bool:
    if len(s) == 0:
        return True
    if len(s) % 2 == 1:
        return False
    list_left = []
    for i in range(len(s)):
        if s[i] == '(':
            list_left.append(-1)
        elif s[i] == ')':
            if len(list_left) == 0 or list_left.pop() + 1 != 0:
                return False
        elif s[i] == '[':
            list_left.append(-2)
        elif s[i] == ']':
            if len(list_left) == 0 or list_left.pop() + 2 != 0:
                return False
        elif s[i] == '{':
            list_left.append(-3)
        elif s[i] == '}':
            if len(list_left) == 0 or list_left.pop() + 3 != 0:
                return False
    if len(list_left) == 0:
        return True
    else:
        return False



